j5xZu/kPi1bs2PfXxaRk8QuMqla/ya3/6nXf3TXKFXgSfQmindxs+MRvFAQ7aE1glerB\n5gtZxnK3tOoyZOTgEE8HfbhpsQFvFMExLYY922KYl16ddnKz4RO/UXBVLAAAgEZw8QQAAIBG\nEOwAAAA0gmAHAACgEQQ7AAAAjSDYAQAAaATBDgAAQCMIdgAAABpBsAMAANAIgh0AAIBG/D9C\nhAX0TwOfdgAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"### Key Findings by Plot\n#### TotalSteps by Usertype\n* Very active users take on an average more than the recommended daily total steps each day (~ ***12,500***)\n* Lightly active users take just about the recommended daily total steps each day\n* Fairly active users maintain a surprisingly consistent distribution in their total daily steps. Could it be they were extremely under-represented? Further analysis would need to be carried out.\n* Most sedentary users make half the total recommended total daily steps which could be detrimental to their health. \n\n#### Calories by Usertype\n* Very active users unsurprisingly have the highest range of calories burnt. The could be correlated with the massive distance they cover daily and the total number of steps they take each day.\n* Lightly active users burn next to the most amount of calories after very active users. An interesting thing to notice is that the average calories burned by this group is more compared to the former (very active) but they have a small range of calories burnt daily.\n* The sedentary and fairly active group have the least range of calories burnt per day which correlates with their activity level during the day.\n\n#### TotalDistance by Usertype\nThis plot emphasizes the big impact distance has on the range of calories burnt by a user.\n* Very active users cover a tremendous amount of distance daily (~ 9.0 miles), almost twice the recommended distance  of **5.0 miles** from CDC. Their average total step per distance covered is **~ 1389 step/mile** (12500/9).\n* Lightly active users cover **6.5 miles** on average daily, not as much as very active users but still impressive as its above the recommended distance. Their average total step per distance covered is **~ 1538 step/mile** (10000/6.5)\nThis explains why very active users burn a lot of calories in comparison to fairly active users because fairly active users need more steps to cover a mile on average than very active users. It could also speak to probably these ones (very active users) engaging in exercise runs which would explain why they're able to cover that much distance with less steps.\n* Fairly active and sedentary users as usual covering less distance due to their level of activity.\n\n#### Average Weight by Usertype\n* Sedentary users had the most average weight (~ 67.4 kg) which is highly correlated to little calories burnt\n* The fairly active users in comparison with the lightly and very active users have the least average weight (**~ 61.4 kg** in comparison to** ~ 66.5 kg** & **~ 62.4 kg**) considering that the latter two groups burns on average more calories. Could it be the type and amount of food they consume as they burn the least range of calories and they wouldn't need much energy-giving foods? One can only speculate. Again more analysis would be needed from a more detailed dataset. ","metadata":{}},{"cell_type":"code","source":"# New dataframe to group user's sleep by activity \n\nsleep_by_usertype <- finalActivity_df %>% group_by(Id) %>%\nsummarise(\nuser_type = factor(case_when(\n    SedentaryMinutes > mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Sedentary\",\n    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes > mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Lightly Active\",\n    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes > mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Fairly Active\",\n    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes > mean(VeryActiveMinutes) ~ \"Very Active\",\n),levels=c(\"Sedentary\", \"Fairly Active\", \"Lightly Active\", \"Very Active\")), TotalMinutesAsleep, TotalTimeInBed, .group=Id) %>%\ndrop_na()\n\n# Plot TotalTimeInBed vs TotalMinutesAsleep\nggplot(sleep_by_usertype, aes(TotalMinutesAsleep, TotalTimeInBed, fill=user_type)) +\n    geom_smooth(method = lm) +\n    geom_point() +\n    facet_wrap(~user_type) +\n    labs(title=\"TotalTimeInBed vs TotalMinutesAsleep\") +\n    theme(legend.position=\"none\", text = element_text(size = 20),plot.title = element_text(hjust = 0.5))\n","metadata":{"execution":{"iopub.status.busy":"2022-05-23T21:43:39.575125Z","iopub.execute_input":"2022-05-23T21:43:39.576633Z","iopub.status.idle":"2022-05-23T21:43:40.299296Z"},"trusted":true},"execution_count":49,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'Id'. You can override using the `.groups`\nargument.\n`geom_smooth()` using formula 'y ~ x'\n\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd0AT1x8A8O/dJSFAQliyVBQU3Iq7jjrrHrVa9/an1r21ddTRarXuVUfdo+69\nd93WPXABKiigsiGQPe73R0IIWYQQkgDfzx963L3cvbvce/ne3XvvCJqmASGEEEIIFX2kvTOA\nEEIIIYSsAwM7hBBCCKFiAgM7hBBCCKFiAgM7hBBCCKFiAgM7hBBCCKFiAgM7hBBCCKFiAgM7\nhBBCCKFiAgM7hBBCCKFiAgM7axKlHCOswd77YQn+xzma/J9LE6tmWv2ApLzpoZkZI1HYaV+t\nI8CJodoR11I9C2kTI/y5eR5bhpOLt29AtQathk/69dzjuELKiQW0v+sMRZEfRx0rBxVN5aDh\nyaS0d7DNgff5Xf+NwZW018D1H6GToDjVGw6IVmQEOTO1v4LFMfzC3qjpk6qEw8AOoRJNIRWl\nJH55/fDfbWsWdqpXtub30yKyZPbOFCq5Hv36Tz4/oZx54mOhZAWZJ/HRlBixXHvOjjmP7JUZ\nBBjYIYS0hZ9aUSekY7gAYztkHxkfFj7Jz6VF5qfl9/iSwssPytP5Ked05nw8OUVa5G+yF2EM\ne2egWHHiNjxy5IixpV+u/zp+/RvVdMPVO6aX4doqX/