Z\n5YZb+/S8Kt/Xp1qzmyfParli0Xebtu05k3jBaQyKaNSqxx39+97Y4uAnS8qyZI+0empcb8fk\njXuOpmWr1WrVdE80+jd+Y+ony75ZsHHrntPnUw1+wRFXtOp205333XylSZGneh2c8+ueTKcE\nBJe20wbUurdt0Lz9mXajudbjUWHel+sDyn3llIZ3K/DC3inpTpeIdB7esfiWLQZ1ly2LReTH\nBX/3fipKRPxqtHt96rT1y5au/W3r33GJmXYJDa8b1eGaXvf1japzyXnThXahYoQ0GNAsYPmR\nbIfJv8kjLQofcKviOnxFMJhrPfXB1A7fLdy4a9/BP49LUFj7rrcOHtI34MwHImK01Pa6YE/X\nLf1Ew37SZkgP2bpQRPxr3NK1mqWoZuVbM5+4L28ZRERRPR8KC6gqvhrS/4cL1trXjJ/28tUl\nt0YBrEDf5MzOzHK4FIN/8KV3khCR40ueGzX7SEDNPgtnDK+0eugnlxs+cV/GHjvoVk7quh8u\nWEXk1uFRWtdSJbECfdbp1a89PeOwKaDFtwvev+SIq+r4dtkpEanb88ZKK4Z+crnhE/dxXDwB\n3YqduUBELMFX9osoOG4fSsYK9Fn1bhkYaFQc2YdHf7EsLv3ieDdZiccWfPDsxtQco6XuyL5X\nVFox9JPLDZ+4j2OPHfQm/cieE3ZL6vE/Pll3VkRaDRzue6dA+DRWoO8zB3V47+m7nv105dGf\nZ4z8ZVa16tXFYU1NzxIRgzls2IRJLQIqfPwF+snlhk+8qiDYQW/ifpky7sdT7r/9a1z5wm1F\nXimGQrECq4TIm0bMbHbl4qU/bt/3Z3xyipiDIhq1at/x2l733dU4tMiT6MsR/eRywydeVRDs\noDdBDa4I8T9nt4S2vrrH4BEPVvN20IfLFiuwqghp2GnoM52GavTq9JPLDZ94VcFVsQAAADrB\nxRMAAAA6QbADAADQCYIdAACAThDsAAAAdIJgBwAAoBMEOwAAAJ0g2AEAAOgEwQ4AAEAnCHYA\nAAA68f8eMYsDS8KSfgAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"Quickly, the slight upward trend is noticed. There's a slight increase in the time it takes users to fall asleep as their activity heightens (sedentary < fairly active < lightly active < very active). The average time to fall asleep for the first three groups (sedentary, fairly active, lightly active) though are almost the same. The very active users have a higher average and can easily be affected by bad sleep patterns.","metadata":{}},{"cell_type":"markdown","source":"# ACT\n\nIn this final process, I'll make recommendations based on insights generated from the above visualizations. However, these recommendeations will be mere generalizations because of the limitations of this dataset. In the future, these recommendations can be open to specifications if a more demographic and sizable dataset present itself.","metadata":{}},{"cell_type":"markdown","source":"### Recommendations\n1. So many new features can result from Bellabeat integrating the **step per mile** algorithm into their app. Some of which can help users who want to shed some weight. Reducing user's daily recommended step/mile can greatly increase the amount of calories they burn and result in weight loss.\n1. Also, the a careful track of the parameters of the fairly active users can be of benefit in helping those who want to maintain a fixed weight, something that's rare in most smart devices. Centering a marketing strategy around this would really be profitable to Bellabeat.\n1. A feature that can track and reduce the average time users take to fall asleep can be of immense help to prevent bad sleeping patterns and habits like insomnia. A sound marketing strategy should also be centered around this targeting users who experience situations liable to cause depression, anxieties and stress. ","metadata":{}},{"cell_type":"markdown","source":"### Further Analysis\nThe limitations of this dataset can be summarized using the `bias()` function:","metadata":{}},{"cell_type":"code","source":"# Checking Distribution Bias\nbias(finalActivity_df$TotalSteps, rep(10000,16384))\nbias(finalActivity_df$TotalDistance, rep(5,16384))","metadata":{"execution":{"iopub.status.busy":"2022-05-23T21:43:40.583989Z","iopub.execute_input":"2022-05-23T21:43:40.585527Z","iopub.status.idle":"2022-05-23T21:43:40.609312Z"},"trusted":true},"execution_count":51,"outputs":[{"output_type":"display_data","data":{"text/html":"-698.470703125","text/markdown":"-698.470703125","text/latex":"-698.470703125","text/plain":"[1] -698.4707"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"1.28463258228999","text/markdown":"1.28463258228999","text/latex":"1.28463258228999","text/plain":"[1] 1.284633"},"metadata":{}}]},{"cell_type":"markdown","source":"The distribution of this dataset is highly skewed due to a small sample size of 33 participants. The distribution is positively skewed as a result of more sedentary users participating incomparison to other groups and negatively skewed due to high values in daily total steps from very active users in a small sample. Therefore to checkmate distribution bias;\n\n1. A larger dataset in which all groups are represented equally would be helpful to reevaluate this analysis to ensure sampling bias is eliminated. This dataset should also contain detailed demographics of users.\n1. A detailed dataset on the lifestyle of fairly active users to confirm or dispute insights from this analysis.","metadata":{}},{"cell_type":"markdown","source":"![Thank you](data:image/jpeg;base64,)","metadata":{}},{"cell_type":"markdown","source":"Thank You for examining my case study. I would love recommendations on improvement in the comments.","metadata":{}}]}